Overworked and Underpaid by Mary Bridget Carroll was released by Walden Tapes in 1984 and is no longer available as a collection. This torrent was made from a 30-year old tape and though cleaned up with the audio program Audacity, you may experience occasional lapses in quality and/or volume. The abrupt and interrupted end to the first file is an artifact of the original recording.

Her hardback version of this audiobook had the full title, Overworked and Underpaid: How To Go From Being a Low-Paid Secretary to being a High Paid Secretary to Hiring Your Own Secretary. Some of the information in this audio book is dated, as you can imagine from a 30-year-old resource, but the philosophy behind the work is universal and is beneficial when combined with other work from others such as Zig Ziglar, Stephen Covey, and John C. Maxwell. Also, the philosophy is applicable to everybody regardless of occupation or gender, not just female secretaries though Carroll spends some time specifically addressing that vocation particularly.

Mary Bridget Carroll no longer publishes material and there is no further information on her recent activities.

